import React, { useEffect, useState } from "react";
import { withStyles, makeStyles } from "@mui/material/styles";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";
import { green, red, blue } from "@mui/material/colors";
import TextField from "@mui/material/TextField";
import FormControl from "@mui/material/FormControl";
import InputAdornment from "@mui/material/InputAdornment";
import InputLabel from "@mui/material/InputLabel";
import Select from "react-select";
import Swal from "sweetalert2";
import { Divider, Grid, Input, Box } from "@mui/material";
import Paper from "@mui/material/Paper";
import { gridSpacing } from "store/constant";
import { Save } from "@mui/icons-material";
import GooglePlacesAutocomplete from "react-google-places-autocomplete";
import { geocodeByPlaceId } from "react-google-places-autocomplete";
import Checkbox from "@mui/material/Checkbox";
import FormControlLabel from "@mui/material/FormControlLabel";
import FormGroup from "@mui/material/FormGroup";
import DataTable from "react-data-table-component";
import IconButton from "@mui/material/IconButton";
import Stack from "@mui/material/Stack";
import SaveSeller from "../helpers/SaveSeller";
import { GetSeller } from "../helpers/GetSeller";
import SellerUpdateForm2 from "./SellerUpdateForm2";

const SellerUpdateForm = ({idcliente}) => {

    const [profile, setprofile] = useState({
    pickupaddress: "",
    legaladdress: "",
    id_cliente: idcliente,
    legalname: "",
    dbaname: "",
    tipocorporacion: "",
    tax_id: "",
    contactname: "",
    cargo: "",
    email: "",
    telefono: "",
    ejecutivoamazon: "",
    website: "",
  });

  const [lista, setlista] = useState('')
  const [lista1, setlista1] = useState('')

  useEffect(() => {
    GetSeller(idcliente).then((response) => {
      setprofile(response[0]);
      setlista1(profile.legaladdress)
      setlista(profile.pickupaddress)
    });
  }, [idcliente, profile.id_cliente, profile.legaladdress, profile.pickupaddress]);

  console.log("PICOS dem ierda", lista1)

  const [botoncito, setbotoncito] = useState({

      oculto: false
  })

  console.log("PICO1", profile)

  const aparecer = () => {

      setbotoncito({

          oculto: true        
      })
  };

  return (

   <div>
     <Button onClick={aparecer}>APARECER</Button>
     { botoncito.oculto ? <SellerUpdateForm2 profile={profile} setprofile={setprofile} idcliente ={idcliente} lista={lista} setlista={setlista} lista1={lista1} setlista1={setlista1}></SellerUpdateForm2> : null}
   </div>
  )

};

export default SellerUpdateForm;
